import React, { useState } from "react";
import 'bootstrap/dist/css/bootstrap.min.css';

function AddBarang({ addBarang, onCancel }) {
  const [namaBarang, setNamaBarang] = useState("");
  const [jenisBarang, setJenisBarang] = useState("");
  const [hargaBarang, setHargaBarang] = useState("");
  const [stokBarang, setStokBarang] = useState("");
  const [errors, setErrors] = useState({});

  const jenisOptions = ["Elektronik", "Pakaian", "Makanan", "Minuman", "Alat Tulis", "Mainan"];

  function handleNamaBarangChange(e) {
    setNamaBarang(e.target.value);
  }

  function handleJenisBarangChange(e) {
    setJenisBarang(e.target.value);
  }

  function handleHargaBarangChange(e) {
    setHargaBarang(e.target.value);
  }

  function handleStokBarangChange(e) {
    setStokBarang(e.target.value);
  }

  function validateForm() {
    const newErrors = {};
    if (!namaBarang) newErrors.namaBarang = "Nama Barang is required";
    if (!jenisBarang) newErrors.jenisBarang = "Jenis Barang is required";
    if (!hargaBarang) newErrors.hargaBarang = "Harga Barang is required";
    if (!stokBarang) newErrors.stokBarang = "Stok Barang is required";
    setErrors(newErrors);
    return Object.keys(newErrors).length === 0;
  }

  function handleSubmit(e) {
    e.preventDefault();
    if (validateForm()) {
      addBarang({
        namaBarang,
        jenisBarang,
        hargaBarang,
        stokBarang,
      });
      setNamaBarang("");
      setJenisBarang("");
      setHargaBarang("");
      setStokBarang("");
    }
  }

  return (
    <div className="card mt-5">
      <div className="card-body">
        <h2 className="card-title">Add Barang</h2>
        <form onSubmit={handleSubmit}>
          <div className="mb-3">
            <label>Nama Barang:</label>
            <input
              type="text"
              className="form-control"
              value={namaBarang}
              onChange={handleNamaBarangChange}
            />
            {errors.namaBarang && <div className="text-danger">{errors.namaBarang}</div>}
          </div>
          <div className="mb-3">
            <label>Jenis Barang:</label>
            <select
              className="form-control"
              value={jenisBarang}
              onChange={handleJenisBarangChange}
            >
              <option value="">Select Jenis Barang</option>
              {jenisOptions.map((option) => (
                <option key={option} value={option}>
                  {option}
                </option>
              ))}
            </select>
            {errors.jenisBarang && <div className="text-danger">{errors.jenisBarang}</div>}
          </div>
          <div className="mb-3">
            <label>Harga Barang:</label>
            <input
              type="text"
              className="form-control"
              value={hargaBarang}
              onChange={handleHargaBarangChange}
            />
            {errors.hargaBarang && <div className="text-danger">{errors.hargaBarang}</div>}
          </div>
          <div className="mb-3">
            <label>Stok Barang:</label>
            <input
              type="text"
              className="form-control"
              value={stokBarang}
              onChange={handleStokBarangChange}
            />
            {errors.stokBarang && <div className="text-danger">{errors.stokBarang}</div>}
          </div>
          <button type="submit" className="btn btn-primary">Add</button>
          <button type="button" className="btn btn-secondary ms-2" onClick={onCancel}>Cancel</button>
        </form>
      </div>
    </div>
  );
}

export default AddBarang;
